import Button from "@material-ui/core/Button"
import TextField from '@material-ui/core/TextField';

function FormularioCadastro(){
return(
   <form>

       <TextField id="nome" label="Nome" variant="outlined" color="secundary"/>
       <TextField id="Sobrenome" label="Sobrenome" variant="outlined" color="secundary"/>
       <TextField id="CPF" label="CPF" variant="outlined" color="secundary"/>

       <label>Promoções</label>
       <input type="checkbox"/>

       <label>Novidades</label>
       <input type="checkbox"/>

       <Button variant="contained" color="primary">Cadastrar</Button>

   </form>

);
}

export default FormularioCadastro;
